import React from "react"
import "./footer.scss"

const Footer = () => {
  const numchanger = () => {
    let num = 1
    console.log(num++)
  }
  const changeNum = () => {
    setInterval(numchanger(), 1000)
  }

  return (
    <div className="footer">
      {changeNum()}
      <div className="footer-dot">
        <h1>FUDO</h1>
      </div>
    </div>
  )
}
export default Footer
